import React, {Component} from 'react'
import Style from './../styles/style'

const demoPurchases = [
  {
    name: 'Перекресток экспресс',
    image: 'data:image/png;base64,',
    value: 1500
  },
  {
    name: 'Макдональдс',
    image: 'data:image/png;base64,',
    value: 100
  },
  {
    name: 'Кристине Мартиновской fdsdf dsaffds fdsadfs dsfads',
    image: 'data:image/png;base64,',
    value: 250,
    comment: '#Обед'
  }
]

import {
  View,
  Text,
  Image
} from 'react-native'

export default class PurchasesBar extends Component {
  render () {
    return (
      <View style={Style.statuwBar}>
        <View style={Style.statuwBar__row}>
          <Text style={[Style.statusBar__text, Style.statusBar__text__left]}>Сегодня</Text>
          <Text style={[Style.statusBar__text, Style.statusBar__text__right]}>
            {
              '- ' + demoPurchases.map((item) => item.value).reduce((a, b) => a + b, 0) + ' ₽'
            }
          </Text>
        </View>
        {
          demoPurchases.map((item, key) => {
            return (
              <View style={[Style.statuwBar__row, Style.statuwBar__row__inside]} key={key}>
                <Image source={{uri: item.image}} style={Style.statusBar__row__image}/>
                <View style={[Style.statusBar__row__centerblock]}>
                  <Text style={Style.statusBar__row__textcenter}>{item.name}</Text>
                  {item.comment &&
                    <Text style={[Style.statusBar__text, Style.statusBar__row__comment]}>{item.comment}</Text>
                  }
                </View>
                <View style={[Style.statusBar__row__blockright]}>
                  <Text style={[Style.statusBar__text__right, Style.statusBar__row__textright, Style.statusBar__row__textcenter]}>
                    {'- ' + item.value.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ' ') + ' ₽'}
                  </Text>
                </View>
              </View>
            )
          })
        }
      </View>
    )
  }
}
